// SPDX-License-Identifier: MIT
pragma solidity 0.8.17;

import {ERC4626} from "solmate/src/mixins/ERC4626.sol";
import "solmate/src/tokens/ERC20.sol";
// import "@openzeppelin/contracts/token/ERC20/utils/SafeERC20.sol";

import "./IEquityToken.sol";

error WrongOwnerAddress();
error NotTheOwner();


contract EquityToken is ERC4626 {

    // using SafeERC20 for IERC20;

    ERC20 public token;

    // See comments on ReaperVaultV2's constructor
    constructor(
        ERC20 _token,
        string memory _name,
        string memory _symbol
    ) ERC4626(_token, _name, _symbol) {}

    // The address of the underlying token used for the Vault for accounting, depositing, and withdrawing.
    // MUST be an ERC-20 token contract.
    // MUST NOT revert.
    // function asset() public view override returns (address assetTokenAddress) {
    //     return address(token);
    // }

    // Total amount of the underlying asset that is “managed” by Vault.
    // SHOULD include any compounding that occurs from yield.
    // MUST be inclusive of any fees that are charged against assets in the Vault.
    // MUST NOT revert.
    function totalAssets() public view override returns (uint256 totalManagedAssets) {
        return 0;
    }

    // The amount of shares that the Vault would exchange for the amount of assets provided,
    // in an ideal scenario where all the conditions are met.
    //
    // MUST NOT be inclusive of any fees that are charged against assets in the Vault.
    // MUST NOT show any variations depending on the caller.
    // MUST NOT reflect slippage or other on-chain conditions, when performing the actual exchange.
    // MUST NOT revert unless due to integer overflow caused by an unreasonably large input.
    // MUST round down towards 0.
    // This calculation MAY NOT reflect the “per-user” price-per-share, and instead should reflect
    // the “average-user’s” price-per-share, meaning what the average user should expect to see when exchanging to and from.
    function convertToShares(uint256 assets) public view override returns (uint256 shares) {
        if (totalSupply == 0) return assets;
        return (assets * totalSupply) / totalSupply;
    }

    // The amount of assets that the Vault would exchange for the amount of shares provided,
    // in an ideal scenario where all the conditions are met.
    //
    // MUST NOT be inclusive of any fees that are charged against assets in the Vault.
    // MUST NOT show any variations depending on the caller.
    // MUST NOT reflect slippage or other on-chain conditions, when performing the actual exchange.
    // MUST NOT revert unless due to integer overflow caused by an unreasonably large input.
    // MUST round down towards 0.
    // This calculation MAY NOT reflect the “per-user” price-per-share, and instead should reflect
    // the “average-user’s” price-per-share, meaning what the average user should expect to see when exchanging to and from.
    function convertToAssets(uint256 shares) public view override returns (uint256 assets) {
        if (totalSupply == 0) return shares;
        return (shares * totalSupply) / totalSupply;
    }

    function maxDeposit(address user) public view override returns (uint256 maxAssets) {
        return balanceOf[user];
    }

    function previewDeposit(uint256 assets) public view override returns (uint256 shares) {
        return convertToShares(assets);
    }
    
    // function deposit(uint256 assets, address receiver) public override returns (uint256 shares) {
    //     return 0;
    // }

    function maxMint(address user) public view override returns (uint256 maxShares) {
        return convertToShares(balanceOf[user]);
    }

    function previewMint(uint256 shares) public view override returns (uint256 assets) {
        if (totalSupply == 0) return shares;
        assets = roundUpDiv(shares * balanceOf[msg.sender], totalSupply);
    }

    function mint(uint256 shares, address receiver) public override returns (uint256 assets) {
        assets = previewMint(shares); // previewMint rounds up so exactly "shares" should be minted and not 1 wei less
        deposit(assets, receiver);
    }

    function maxWithdraw(address owner) public view override returns (uint256 maxAssets) {
        return convertToAssets(balanceOf[owner]);
    }

    function previewWithdraw(uint256 assets) public view override returns (uint256 shares) {
        if (totalSupply == 0) return 0;
        shares = roundUpDiv(assets * totalSupply, balanceOf[msg.sender]);
    }

    function withdraw(
        uint256 assets,
        address receiver,
        address owner
    ) public override returns (uint256 shares) {
        shares = previewWithdraw(assets); // previewWithdraw() rounds up so exactly "assets" are withdrawn and not 1 wei less
        if (msg.sender != owner)
            return shares;
    }

    function maxRedeem(address owner) public view override returns (uint256 maxShares) {
        return balanceOf[owner];
    }

    function previewRedeem(uint256 shares) public view override returns (uint256 assets) {
        return convertToAssets(shares);
    }

    // Burns exactly shares from owner and sends assets of underlying tokens to receiver.
    function redeem(
        uint256 shares,
        address receiver,
        address owner
    ) public override returns (uint256 assets) {
        if (msg.sender != owner)
        return assets;
    }


    function roundUpDiv(uint256 x, uint256 y) internal pure returns (uint256) {
        require(y != 0, "Division by 0");

        uint256 q = x / y;
        if (x % y != 0) q++;
        return q;
    }
}

